// Asset exports for easy importing throughout the app
// Usage: import { NibJobsLogo, TelegramIcon } from '../assets';

// App Icons & Logos - Bee-themed NibJobs branding
export const AppIcon = require('../../assets/icon.png');           // Main bee icon
export const NibJobsIcon = require('../../assets/icon.png');       // Use bee icon as main brand
export const BeeIcon = require('../../assets/icon.png');           // Explicit bee icon reference
export const NibJobsBeeIcon = require('../../assets/nibjobs-icon.png'); // Backup reference

// Logos
export const NibJobsLogo = require('./images/logos/nibjobs-logo.png');
export const NibJobsLogoWhite = require('./images/logos/nibjobs-logo-white.png');
export const NibJobsWordmark = require('./images/logos/nibjobs-wordmark.png');

// UI Icons
export const TelegramIcon = require('./images/icons/telegram-icon.png');
export const UploadIcon = require('./images/icons/upload-icon.png');
export const SearchIcon = require('./images/icons/search-icon.png');
export const FilterIcon = require('./images/icons/filter-icon.png');

// Illustrations
export const EmptyStateIllustration = require('./images/illustrations/empty-state.png');
export const ErrorStateIllustration = require('./images/illustrations/error-state.png');
export const LoadingAnimation = require('./images/illustrations/loading-animation.gif');

// Background Images
export const HeroBackground = require('./images/backgrounds/hero-bg.png');
export const PatternBackground = require('./images/backgrounds/pattern-bg.png');

// Default exports for TypeScript
export default {
  AppIcon,
  NibJobsIcon,
  NibJobsLogo,
  NibJobsLogoWhite,
  NibJobsWordmark,
  TelegramIcon,
  UploadIcon,
  SearchIcon,
  FilterIcon,
  EmptyStateIllustration,
  ErrorStateIllustration,
  LoadingAnimation,
  HeroBackground,
  PatternBackground,
};
